class TestBaseTest extends TestBase
   method TestBaseTest();

   method Setup();
   method Run();
   method Teardown();

   method TestAsserts();
   method TestMessages();

   property TestBase base;
end-class;

Component string &messages;

method TestBaseTest
   %Super = create TestBase("TestBaseTest");
end-method;

method Setup
   /+ Extends/implements TTS_UNITTEST:TestBase.Setup +/
   &base = create TestBase("TestBase");
end-method;

method Run
   /+ Extends/implements TTS_UNITTEST:TestBase.Run +/
   %This.TestAsserts();
   %This.TestMessages();

   &base.Setup();
   try
      &base.Run();
      throw CreateException(0, 0, "Expected an exception when calling TestBase.Run()!");
   catch Exception &e
   end-try;
   &base.Teardown();

end-method;

method Teardown
   /+ Extends/implements TTS_UNITTEST:TestBase.Teardown +/
end-method;

method TestAsserts
   &base.Assert( True, "This should NOT throw an exception!");

   Local boolean &ok = True;
   try
      &base.Assert( False, "This should throw an exception (e1).");
      &ok = False;
   catch Exception &e1
   end-try;
   If ( Not &ok) Then
      throw CreateException(0, 0, "Assert (false, ""..."") should've thrown an exception!");
   End-If;

   &base.AssertNumbersEqual(1, 1, "This should NOT throw an exception!");
   try
      &base.AssertNumbersEqual(1, 2, "This should throw an exception (e2).");
      &ok = False;
   catch AssertFailed &e2
   end-try;
   If ( Not &ok) Then
      throw CreateException(0, 0, "AssertNumbersEqual (1, 2, ""..."") should've thrown an exception!");
   End-If;

   &base.AssertNumbersDiffer(2, 9, "This should NOT throw an exception!");
   try
      &base.AssertNumbersDiffer(1, 1, "This should throw an exception (e3).");
      &ok = False;
   catch AssertFailed &e3
   end-try;
   If ( Not &ok) Then
      throw CreateException(0, 0, "AssertNumbersDiffer (1, 1, ""..."") should've thrown an exception!");
   End-If;

   &base.AssertStringsEqual("One", "One", "This should NOT throw an exception!");
   try
      &base.AssertStringsEqual("One", "Two", "This should throw an exception (e4).");
      &ok = False;
   catch AssertFailed &e4
   end-try;
   If ( Not &ok) Then
      throw CreateException(0, 0, "AssertStringsEqual (""One"", ""Two"", ""..."") should've thrown an exception!");
   End-If;

   &base.AssertStringsDiffer("2", "9", "This should NOT throw an exception!");
   try
      &base.AssertStringsDiffer("1", "1", "This should throw an exception (e5).");
      &ok = False;
   catch AssertFailed &e5
   end-try;
   If ( Not &ok) Then
      throw CreateException(0, 0, "AssertStringsDiffer (""1"", ""1"", ""..."") should've thrown an exception!");
   End-If;
end-method;

method TestMessages
   Local string &test = "ALASKsajlsdkjfasdf;";

   &base.Msg(&test);
   Local number &ii = Find(&test, &messages);
   %This.Assert((&ii > 0), "The message string not found in testmsgs!");
end-method;

import TTS_UNITTEST:Exceptions:*;
import TTS_UNITTEST:Constants;

/** This is the base class which developers must extend in order to code their test(s). 
    The methods to be overridden are Setup(), Run() and Teardown().  The test runners always
    call these methods in that order for each test class.  Finally, the PSUnit test runner 
    attempts to call Teardown() will be called even when there are errors; it does not always
    succeed, but that's another story.

    In addition, there are the helper methods for asserting various invariant conditions.  
    The pattern is: Assert (&condition_which_must_be_true, "The expected condition was not met!");
    In other words, the first argument to Assert() is a condition which you expect to be true.
    The second is an error message to print if the condition is not met.  The other Assert*()
    methods are more syntactic sugar. */

class TestBase
   property string UnitTestName readonly;
   property string status;
   property string PASSED readonly;
   property string FAILED readonly;
   property string NOT_RUN readonly;

   /** The constructor.  Developers should pass in a test name as the sole
    argument.  For now, PSUnit does nothing with the name, but the plan was to use it to do some
    nifty error tracking, etc. */
   method TestBase(&UnitTestName_in As string);

   /** The first method of the test class to be called during a run. */
   method Setup();
   /** The last method of the test class to be called during a run.  The framework tries to call this
    method even after an error.  Due to inconsistent exception handling by the PeopleCode runtime,
    a PeopleCode "catch" statement does not catch all exceptions, and so PSUnit cannot guarantee this.
    Examples of untrappable errors are calls to the Error() builtin, SQL errors, PeopleCode compile 
    errors, etc. */
   method Teardown();
   /** The method which MUST be overriden to implement the actual test developers want to write.  Note
    that not overriding this method is an error! */
   method Run();

   /** The first argument must be a boolean expression, which should evaluate to true.  If false, PSUnit 
    throws an exception to indicate that the test failed.  The test runner catches the exception, marks
    the test as having failed, and continues on to the next test. */
   method Assert(&isTrue As boolean, &onFail As string);
   method AssertStringsEqual(&str1 As string, &str2 As string, &onFail As string);
   method AssertStringsDiffer(&str1 As string, &str2 As string, &onFail As string);
   method AssertNumbersEqual(&num1 As number, &num2 As number, &onFail As string);
   method AssertNumbersDiffer(&num1 As number, &num2 As number, &onFail As string);
   method AssertDatesEqual(&date1 As date, &date2 As date, &onFail As string);
   method AssertDatesDiffer(&date1 As date, &date2 As date, &onFail As string);
   method AssertRowsetValuesEqual(&rs1 As Rowset, &rs2 As Rowset, &onFail As string);

   method Msg(&msg As string);
   method HTMLMsg(&htmlMsg As string);
   property Constants const;
end-class;

Declare Function GetConstants PeopleCode TTS_TESTRUN_WRK.TTS_RUN_TESTS FieldFormula;
Component string &messages;
Component string &html;

method Assert
   /+ &isTrue as Boolean, +/
   /+ &onFail as String +/

   If ( Not (&isTrue)) Then
      throw create AssertFailed(&onFail);
   End-If;

end-method;

method AssertStringsEqual
   /+ &str1 as String, +/
   /+ &str2 as String, +/
   /+ &onFail as String +/

   If (&str1 <> &str2) Then
      Local string &msg = &str1 | " <> " | &str2 | "! " | &onFail;
      throw create AssertFailed(&msg);
   End-If;

end-method;

method AssertStringsDiffer
   /+ &str1 as String, +/
   /+ &str2 as String, +/
   /+ &onFail as String +/

   If (&str1 = &str2) Then
      Local string &msg = &str1 | " = " | &str2 | "! " | &onFail;
      throw create AssertFailed(&msg);
   End-If;

end-method;

method AssertNumbersEqual
   /+ &num1 as Number, +/
   /+ &num2 as Number, +/
   /+ &onFail as String +/

   If (&num1 <> &num2) Then
      Local string &msg = String(&num1) | " <> " | String(&num2) | "! " | &onFail;
      throw create AssertFailed(&msg);
   End-If;

end-method;

method AssertNumbersDiffer
   /+ &num1 as Number, +/
   /+ &num2 as Number, +/
   /+ &onFail as String +/

   If (&num1 = &num2) Then
      Local string &msg = String(&num1) | " = " | String(&num2) | "! " | &onFail;
      throw create AssertFailed(&msg);
   End-If;

end-method;

method AssertDatesEqual
   /+ &date1 as Date, +/
   /+ &date2 as Date, +/
   /+ &onFail as String +/
   If (&date1 <> &date2) Then
      Local string &msg = String(&date1) | " <> " | String(&date2) | "! " | &onFail;
      throw create AssertFailed(&msg);
   End-If;
end-method;

method AssertDatesDiffer
   /+ &date1 as Date, +/
   /+ &date2 as Date, +/
   /+ &onFail as String +/
   If (&date1 = &date2) Then
      Local string &msg = String(&date1) | " = " | String(&date2) | "! " | &onFail;
      throw create AssertFailed(&msg);
   End-If;
end-method;

method TestBase
   /+ &UnitTestName_in as String +/
   &const = GetConstants();
   &UnitTestName = &UnitTestName_in;
   &PASSED = &const.TEST_STATUS_PASSED;
   &FAILED = &const.TEST_STATUS_FAILED;
   &NOT_RUN = "";

end-method;

method Setup
end-method;

method Teardown
end-method;

method Run
   throw create AssertFailed("TestBase base class method Run() should always be overridden!");
end-method;


method Msg
   /+ &msg as String +/
   &messages = &messages | &msg | Char(13);
end-method;


method HTMLMsg
   /+ &htmlMsg as String +/
   &html = &html | &htmlMsg | "<BR>" | Char(13);
end-method;

method AssertRowsetValuesEqual
   /+ &rs1 as Rowset, +/
   /+ &rs2 as Rowset, +/
   /+ &onFail as String +/
   Local number &rowCount;
   Local number &recordCount;
   Local number &fieldCount;
   Local string &rs1RecName;
   Local string &rs2RecName;
   Local string &msg;
   Local Record &rs1Rec;
   Local Record &rs2Rec;

   If &rs1.ActiveRowCount < &rs2.ActiveRowCount Then
      throw create AssertFailed("Rowset 1 has fewer rows than Rowset 2");
   End-If;

   If &rs1.ActiveRowCount > &rs2.ActiveRowCount Then
      throw create AssertFailed("Rowset 2 has fewer rows than rowset 1");
   End-If;

   For &rowCount = 1 To &rs1.ActiveRowCount
      For &recordCount = 1 To &rs1(&rowCount).RecordCount
         &rs1RecName = &rs1(&rowCount).GetRecord(&recordCount).Name;
         &rs2RecName = &rs2(&rowCount).GetRecord(&recordCount).Name;
         If &rs1RecName <> &rs2RecName Then
            &msg = "Rowsets are comprised of different records.  " | &rs1RecName | " <> " | &rs2RecName;
            throw create AssertFailed(&msg | &onFail);
         End-If;

         &rs1Rec = &rs1(&rowCount).GetRecord(&recordCount);
         &rs2Rec = &rs2(&rowCount).GetRecord(&recordCount);
         For &fieldCount = 1 To &rs1Rec.FieldCount
            If &rs1Rec.GetField(&fieldCount).Value <> &rs2Rec.GetField(@("Field." | &rs1Rec.GetField(&fieldCount).Name)).Value Then
               &msg = "Row " | &rowCount | ", Record " | &rs1.DBRecordName | ", Field " | &rs1Rec.GetField(&fieldCount).Name | " values do not match!  " | &rs1Rec.GetField(&fieldCount).Value | " <> " | &rs2Rec.GetField(@("Field." | &rs1Rec.GetField(&fieldCount).Name)).Value;
               throw create AssertFailed(&msg | &onFail);
            End-If;
         End-For;
      End-For;
   End-For;
end-method;
